Real user id is the user that spawned the process. Effective user id is the user determined by the setuid bit on the binary being executed. Difference between Real User ID, Effective User ID and Saved User ID 【演示】可执行脚本文件不允许设置 suid 或者不会生效，我们需要制作一个二进制文件 #include <stdio.h>
#include <stdlib.h>
#include <sys/types.h>
#include <unistd.h> int main(void) { uid_t ruid = getuid(); uid_t euid = geteuid(); printf("ruid:%d, euid:%d\n", ruid, euid); return 0;
} 编译之后修改权限 $ sudo chown root:root a.out
$ sudo chmod ugo+sx a.out
$ ls -l
total 24
-rwsr-sr-x 1 root root 18272 Mar 21 23:22 a.out
-rw-rw-rw- 1 qaq qaq 208 Mar 21 23:21 id-r.c 可以看到程序的 real ID 是 qaq，effective ID 是 root $ ./a.out
ruid:1000, euid:0
